import React from 'react';
import styled from 'styled-components';



export default function Reviews (props) {
    const {reviews} = props;

    return (
        reviews.map((review) => {
            return(
            <StyledDiv> 
                <h1> 
                    {review.title} 
                </h1>
                <br></br>
                <h3> {review.userName} </h3>
                <br></br>
                <p>{review.reviewBody}</p>
            </StyledDiv>
            )
        })
    );
};

const StyledDiv = styled.div `
background-color: red;
`
